// background-parallax-vpn-setup

const DownloadSetupCoreVPNDataInformationHelper = (props) => {
    return (
        <Fragment>
            <Parallax
                className={"background-parallax-vpn-setup-img"} 
                bgImage={require('../../../../assets/images/anon.jpg')}
                renderLayer={percentage => {
                    console.log("percentage", percentage);
                    return (
                        <div
                            style={{
                                position: 'absolute',
                                background: `rgba(255, 125, 0, ${percentage * 1})`,
                                left: '50%',
                                top: '50%',
                                width: percentage * 500,
                                height: percentage * 500,
                            }}
                        />
                    );
                }}
            >
                <p>... Content</p>
            </Parallax>
            <Container fluid={true}>
                <Row>
                    <Col sm="12" md="12" lg="12" xl="12">
                        <h1>hello.</h1>
                    </Col>
                </Row>
            </Container>
        </Fragment>
    );
}
export default DownloadSetupCoreVPNDataInformationHelper;
